import { exportchart } from "../js/exportchart";
import Server from "@/core/server";
import { services } from "@/core/config/services";
	export default {
		name: '',
		data () {
		  return {
			msg:'vue'
	  }
	},
	mounted(){
	  this.drawLine1();
	},
	methods: {
	  drawLine1(){
		  // 基于准备好的dom，初始化echarts实例
		  let myChart = this.$echarts.init(document.getElementById('rightop'))
		  // 绘制图表
		  myChart.setOption({
			  title: { text: '柱状图',left: 'center',paddingTop:'10px'},
			  tooltip: {},
			  xAxis: {
				  data: ["衬衫","羊毛衫","雪纺衫","裤子","高跟鞋","袜子"]
			  },
			  yAxis: {},
			  series: [{
				  name: '销量',
				  type: 'bar',
				  data: [5, 20, 36, 10, 10, 20]
			  }]
		  });
	  }
	}
}
